import './Input.css';
import Media from 'react-media';

// Input Form Component 
export default function REturnInput() {
 return (
  <Media
   queries={{
    small: '(max-width: 599px)',
    medium: '(min-width: 600px) and (max-width:1199px)',
    large: '(min-width: 1200px)',
   }}>
   {matches => (
    <>
     {matches.small && <ScreenSmall />}
     {matches.medium && <ScreenLarge />}
     {matches.large && <ScreenLarge />}
    </>
   )}
  </Media>
 );
};


export const ScreenLarge = () => {
 return (
  <div className='wrp-input-signup'>
   <form>

    <label>Nom du Compte</label>
    <input type='text' name='account' />

    <label>Nom</label>
    <input type='text' name='firstname' />

    <label>Prenome</label>
    <input type='text' name='lastname' />

    <label>Ville</label>
    <input type='text' name='city' />

    <label>Address</label>
    <input type='text' name='contry' />

    <label>Emaill</label>
    <input type='text' name='email' />

    <label>Telephone</label>
    <input type='text' name='phone' />

    <button className='btn btn-width'>Enregistre</button>
   </form>
  </div>
 );
}
export const ScreenSmall = () => {
 return (
  <div className='wrp-input-signup-sm'>
   <form>

    <label>Nom du Compte</label>
    <input type='text' name='account' />

    <label>Nom</label>
    <input type='text' name='firstname' />

    <label>Prenome</label>
    <input type='text' name='lastname' />

    <label>Ville</label>
    <input type='text' name='city' />

    <label>Address</label>
    <input type='text' name='contry' />

    <label>Emaill</label>
    <input type='text' name='email' />

    <label>Telephone</label>
    <input type='text' name='phone' />

    <button className='btn btn-width-sm'>Enregistre</button>
   </form>
  </div>
 );
}
